import React, { useState } from "react";
import { Link } from "react-router-dom";
import AuthModal from "./AuthModal";
import SubscriptionModal from "./SubscriptionModal";

const Navbar = () => {
  const [isAuthOpen, setAuthOpen] = useState(false);
  const [isSubOpen, setSubOpen] = useState(false);

  return (
    <>
      <nav className="bg-gray-900 text-white flex justify-between items-center px-8 py-4">
        <h1 className="text-2xl font-bold">Video Store</h1>
        <ul className="flex gap-6">
          <li><Link to="/" className="hover:text-red-500">Home</Link></li>
          <li><Link to="/movies" className="hover:text-red-500">Movies</Link></li>
          <li>
            <button
              onClick={() => setAuthOpen(true)}
              className="bg-red-500 px-4 py-2 rounded-lg"
            >
              Login
            </button>
          </li>
          <li>
            <button
              onClick={() => setSubOpen(true)}
              className="bg-green-500 px-4 py-2 rounded-lg"
            >
              Subscribe
            </button>
          </li>
        </ul>
      </nav>

      <AuthModal isOpen={isAuthOpen} onClose={() => setAuthOpen(false)} />
      <SubscriptionModal isOpen={isSubOpen} onClose={() => setSubOpen(false)} />
    </>
  );
};

export default Navbar;
